int in[1005];
int votecnt[1234];
int vote[maxproblem];
bool isexist[maxproblem], vis[1234];
int testlist[123], testcnt;

void init() {
    memset(isexist, 0, sizeof isexist);
}
int deal() {
    int maxcnt = 0, ret = -1;
    for(int i = 1; i < maxproblem; i++) {
        votecnt[vote[i]]++;
        if(vote[i] > maxcnt) {
            maxcnt = vote[i];
            ret = i;
        }
    }
    return ret;
}
int recommand1(int n, int id, int weight = 0, bool random = 0) {
//    printf("%d %d %d ", n, id, in[id]);
    int cmp = in[id];
    if(!weight) memset(vote, 0, sizeof vote);
    memset(isexist, 0, sizeof isexist);
    for(int i = 1; i <= id; i++) isexist[in[i]] = 1;
    for(int i = 1; i <= pplcnt; i++) {
        int testid = ppllist[i];
        for(int j = 1; j <= db[testid][0]; j++) {
            if(db[testid][j] == cmp) {
                int step = (rand() % 2) ? 1 : -1;
                if(!random) step = 1;
                for(int k = j + step; k >= 1 && k <= db[testid][0]; k += step) {
                    if(!isexist[db[testid][k]]) {
                        if(!weight) {
                            vote[db[testid][k]]++;
//                            printf("%d %d\n", j, k);
                        }
                        else {
                            vote[db[testid][k]] += weight;
                        }
                        break;
                    }
                }
            }
        }
    }
    int ret = deal();
//    printf("%d %d %d\n", in[n - 1], in[n], ret);
    return ret;
}
int recommand2(int n, int id) {
    memset(vote, 0, sizeof vote);
    return recommand1(n, id, 0, 1);
}
int recommand3(int n, int id) {
    memset(vote, 0, sizeof vote);
    if(id - 2 > 0) recommand1(n, id - 2, 1, 0);
    if(id - 1 > 0) recommand1(n, id - 1, 2, 0);
    recommand1(n, id, 3, 0);
    int ret = deal();
    return ret;
}
int recommand4(int n, int id) {
    memset(vote, 0, sizeof vote);
    if(id - 2 > 0) recommand1(n, id - 2, 1, 1);
    if(id - 1 > 0) recommand1(n, id - 1, 2, 1);
    recommand1(n, id, 3, 1);
    int ret = deal();
    return ret;
}
int recommand5(int n, int id) {
    memset(vote, 0, sizeof vote);
    memset(isexist, 0, sizeof isexist);
    for(int i = 1; i <= id; i++) isexist[in[i]] = 1;
    for(int i = 1; i <= pplcnt; i++) {
        int testid = ppllist[i];
        for(int j = 1; j <= db[testid][0]; j++) {
            if(!isexist[db[testid][j]]) {
                vote[db[testid][j]]++;
                break;
            }
        }
    }
    int ret = deal();
    return ret;
}
int recommand6(int n, int id) {
    memset(vote, 0, sizeof vote);
    int rec[5] = {0};
    memset(isexist, 0, sizeof isexist);
    for(int i = 1; i <= id; i++) isexist[in[i]] = 1;
    for(int i = 1; i <= pplcnt; i++) {
        int cnt = 0;
        int testid = ppllist[i];
        for(int j = 1; j <= db[testid][0] && cnt < 3; j++) {
            if(!isexist[db[testid][j]]) {
                rec[cnt++] = db[testid][j];
            }
        }
        int id;
        if(cnt > 0) {
            id = rand() % cnt;
            vote[rec[id]]++;
        }
    }
    int ret = deal();
    return ret;
}
void getRandomID(int T, int n) {
    testcnt = 0;
    memset(vis, 0, sizeof vis);
    while(testcnt < T && testcnt < n) {
        int t = (rand() % (n - 1)) + 1;     //id1~n-1
        if(!vis[t]) {
            testlist[testcnt++] = t;
            vis[t] = 1;
        }
    }
}
void getRandomPpl() {
    int cnt = 1;
    bool visppl[1234] = {0};
    while(cnt <= pplcnt) {
        bool flag = 0;
        int t = (rand() % 200) + 1;
        if(!visppl[t]) {
            visppl[t] = 1;
            ppllist[cnt++] = t;
        }
    }
}
void input() {
    int T;
    int res[10] = {0};
    int test_cnt_per_person = 10;
    scanf("%d", &pplcnt);
    printf("pplcnt:%d\n", pplcnt);
    getRandomPpl();
    scanf("%d", &test_cnt_per_person);
    printf("test_cnt_per_person:%d\n", test_cnt_per_person);
    scanf("%d", &T);
    printf("total:%d\n", T);
    for(int cas = 1; cas <= T; cas++) {
        int n;
        init();
        scanf("%d", &n);
        for(int i = 1; i <= n; i++) {
            scanf("%d", &in[i]);
        }
        getRandomID(test_cnt_per_person, n);
        for(int i = 0; i < test_cnt_per_person && i < n; i++) {
//            printf("%d %d\n", recommand2(n, testlist[i]), in[testlist[i] + 1]);
            if(recommand1(n, testlist[i]) == in[testlist[i] + 1]) res[1]++;
            if(recommand2(n, testlist[i]) == in[testlist[i] + 1]) res[2]++;
            if(recommand3(n, testlist[i]) == in[testlist[i] + 1]) res[3]++;
            if(recommand4(n, testlist[i]) == in[testlist[i] + 1]) res[4]++;
            if(recommand5(n, testlist[i]) == in[testlist[i] + 1]) res[5]++;
            if(recommand6(n, testlist[i]) == in[testlist[i] + 1]) res[6]++;
        }
    }
    for(int i = 1; i <= 6; i++) {
        printf("recommandation algorithm #%d: %d %.2f%%\n", i, res[i], 100.0 * res[i] / T / test_cnt_per_person);
    }
}
